import React from "react";
import { useParams } from "react-router-dom";

const User = () => {
     
    const {fname}=useParams()

  return (
   
      <>
        <ul>
           <li>
              <Navbar to="/"> user {fname} </Navbar>
           </li>
        </ul>
        
      </>
    
  );
};

export default User;
